import classes from "./AddReview.module.css";
import Button from "./UI/Button";

function AddReview() {
  return (
    <div className="container">
      <Button title="Add a review" />
      <div>Select rating</div>
      <div>Add a feedback</div>
      <div className="container">
        <Button title="Submit" />
      </div>
    </div>
  );
}

export default AddReview;
